import React, { useState, useEffect } from 'react';
import Header from './components/Header.jsx';
import Hero from './components/Hero.jsx';
import Footer from './components/Footer.jsx';
import Modal from './components/Modal.jsx';

function App() {
  const [isModalOpen, setIsModalOpen] = useState(false);
  const [modalContent, setModalContent] = useState({ title: '', body: '' });

  const handleNavClick = (section) => {
    const content = getModalContent(section);
    setModalContent(content);
    setIsModalOpen(true);
  };

  const handleWorkClick = () => {
    const content = getModalContent('portfolio');
    setModalContent(content);
    setIsModalOpen(true);
  };

  const closeModal = () => {
    setIsModalOpen(false);
  };

  const getModalContent = (section) => {
    const content = {
      resume: {
        title: 'Resume',
        body: `
          <div class="resume-content">
            <h4 style="margin-bottom: 16px; color: var(--color-primary);">Professional Experience</h4>
            <p style="margin-bottom: 12px;"><strong>Full Stack Developer</strong> - Tech Company (2022-Present)</p>
            <p style="margin-bottom: 24px; color: var(--color-text-secondary);">Developed and maintained web applications using modern technologies including React.js, Node.js, and various databases.</p>
            
            <h4 style="margin-bottom: 16px; color: var(--color-primary);">Skills</h4>
            <p style="margin-bottom: 12px;">• Frontend: React.js, JavaScript, HTML5, CSS3, Tailwind CSS</p>
            <p style="margin-bottom: 12px;">• Backend: Node.js, Python, Express.js</p>
            <p style="margin-bottom: 24px;">• Database: MongoDB, PostgreSQL, MySQL</p>
            
            <h4 style="margin-bottom: 16px; color: var(--color-primary);">Education</h4>
            <p><strong>Computer Science Degree</strong> - University Name (2018-2022)</p>
          </div>
        `
      },
      contact: {
        title: 'Contact Me',
        body: `
          <div class="contact-content">
            <p style="margin-bottom: 24px;">I'd love to hear from you! Let's connect and discuss opportunities.</p>
            
            <div style="margin-bottom: 16px;">
              <strong style="color: var(--color-primary);">Email:</strong><br>
              <a href="mailto:saqlain@example.com" style="color: var(--color-primary);">saqlain@example.com</a>
            </div>
            
            <div style="margin-bottom: 16px;">
              <strong style="color: var(--color-primary);">Phone:</strong><br>
              <span>+1 (555) 123-4567</span>
            </div>
            
            <div style="margin-bottom: 24px;">
              <strong style="color: var(--color-primary);">Location:</strong><br>
              <span>City, State, Country</span>
            </div>
            
            <p style="color: var(--color-text-secondary);">
              Feel free to reach out through any of the social media platforms linked in the footer as well!
            </p>
          </div>
        `
      },
      about: {
        title: 'About Me',
        body: `
          <div class="about-content">
            <p style="margin-bottom: 16px;">
              Hello! I'm Saqlain Sheikh, a passionate full-stack developer with a love for creating 
              beautiful, functional, and user-friendly applications.
            </p>
            
            <p style="margin-bottom: 16px;">
              I specialize in modern web technologies and enjoy working on challenging projects 
              that push the boundaries of what's possible on the web. My experience spans across 
              frontend and backend development, with a focus on React.js ecosystem.
            </p>
            
            <p style="margin-bottom: 24px;">
              When I'm not coding, you can find me exploring new technologies, contributing to 
              open-source projects, or enjoying outdoor activities.
            </p>
            
            <div style="margin-bottom: 16px;">
              <strong style="color: var(--color-primary);">What I Do:</strong>
            </div>
            <ul style="margin: 0; padding-left: 20px;">
              <li style="margin-bottom: 8px;">Web Application Development</li>
              <li style="margin-bottom: 8px;">UI/UX Design Implementation</li>
              <li style="margin-bottom: 8px;">API Development & Integration</li>
              <li style="margin-bottom: 8px;">Performance Optimization</li>
            </ul>
          </div>
        `
      },
      portfolio: {
        title: 'My Work',
        body: `
          <div class="portfolio-content">
            <p style="margin-bottom: 24px;">
              Here are some of my recent projects and accomplishments:
            </p>
            
            <div style="margin-bottom: 20px; padding: 16px; background: var(--color-bg-1); border-radius: 8px;">
              <h5 style="margin-bottom: 8px; color: var(--color-primary);">E-Commerce Platform</h5>
              <p style="margin-bottom: 8px; color: var(--color-text-secondary);">
                Full-stack e-commerce solution built with React.js and Node.js
              </p>
              <p style="font-size: 12px; color: var(--color-text-secondary);">
                Technologies: React, Node.js, MongoDB, Stripe API
              </p>
            </div>
            
            <div style="margin-bottom: 20px; padding: 16px; background: var(--color-bg-2); border-radius: 8px;">
              <h5 style="margin-bottom: 8px; color: var(--color-primary);">Task Management App</h5>
              <p style="margin-bottom: 8px; color: var(--color-text-secondary);">
                Collaborative project management tool with real-time updates
              </p>
              <p style="font-size: 12px; color: var(--color-text-secondary);">
                Technologies: React, Socket.io, Express.js, PostgreSQL
              </p>
            </div>
            
            <div style="margin-bottom: 20px; padding: 16px; background: var(--color-bg-3); border-radius: 8px;">
              <h5 style="margin-bottom: 8px; color: var(--color-primary);">Portfolio Website</h5>
              <p style="margin-bottom: 8px; color: var(--color-text-secondary);">
                This very website you're looking at right now!
              </p>
              <p style="font-size: 12px; color: var(--color-text-secondary);">
                Technologies: React, Custom CSS, Design System
              </p>
            </div>
            
            <p style="color: var(--color-text-secondary); text-align: center; margin-top: 24px;">
              More projects coming soon...
            </p>
          </div>
        `
      }
    };

    return content[section] || {
      title: 'Page Not Found',
      body: '<p>This section is coming soon!</p>'
    };
  };

  // Handle escape key to close modal
  useEffect(() => {
    const handleEscape = (e) => {
      if (e.key === 'Escape' && isModalOpen) {
        closeModal();
      }
    };

    document.addEventListener('keydown', handleEscape);
    return () => document.removeEventListener('keydown', handleEscape);
  }, [isModalOpen]);

  // Handle body scroll when modal is open
  useEffect(() => {
    if (isModalOpen) {
      document.body.style.overflow = 'hidden';
    } else {
      document.body.style.overflow = '';
    }

    return () => {
      document.body.style.overflow = '';
    };
  }, [isModalOpen]);

  return (
    <div className="App">
      <Header onNavClick={handleNavClick} />
      <Hero onWorkClick={handleWorkClick} />
      <Footer />
      <Modal 
        isOpen={isModalOpen}
        onClose={closeModal}
        title={modalContent.title}
        body={modalContent.body}
      />
    </div>
  );
}

export default App;
